import React from 'react'

function message() {
    return (
        <React.Fragment >
            <p>El producto ya fue agregado a tu carrito!</p>
            <button>Seguir comprando</button>
            <button>Proceder al pago</button>
        </React.Fragment>
    )
}

export default message
